    font-weight: 400;
    font-size: 28px;
    line-height: 33px;
    color: #000000;
    margin-bottom: 20px;
  }

  .goods__item-header{
    margin-bottom: 20px;
  }

  .goods__item{
    max-width: 181px;
    box-shadow: 0px 4px 40px rgba(0, 0, 0, 0.12);
    border-radius: 4px;
    padding: 11px;
    transition: all ease 0.2s;
  }

  .goods__wrapper{
    display: flex;
    flex-wrap: wrap;
    gap: 40px;
  }

  .item-header-image{
    position: relative;
  }

  .item-image-discount{
    display: block;
    position: absolute;
    top: 5px;
    right: 10px;
    font-family: var(--font-roboto-regular);
    font-weight: 500;
    font-size: 10px;
    line-height: 12px;
    color: #000000;
    border: 0.5px solid #FF4343;
    border-radius: 8px;
    padding: 2px 6px 4px;
  }

  .goods__item-price{
    font-family: var(--font-roboto-regular);
    font-weight: 500;
    font-size: 14px;
    line-height: 16px;
    color: #FF4343;
    display: block;
    
  }

  .goods__item-old-price{
    font-family: var(--font-roboto-regular);
    font-weight: 400;
    font-size: 10px;
    line-height: 12px;
    color: rgba(70, 70, 70, 0.55);
    display: block;
    position: relative;
  }

  .goods__item-old-price::after{
    content: '';
    width: 35px;
    height: 2px;
    background-color: #F64D4D;
    position: absolute;
    left: 0;
    top: 40%;
    transform: matrix(1, -0.09, 0.08, 1, 0, 0);
  }


  .price-wrapper{
    display: flex;
    margin-bottom: 8px;
    gap: 20px;
    align-items: center;
  }

  .goods__item-text{
    font-family: var(--font-roboto-regular);
    font-weight: 300;
    font-size: 12px;
    line-height: 124.19%;
    color: #000000;
  }

  .goods__item-text-hover{
    font-family: var(--font-roboto-regular);
    font-weight: 300;
    font-size: 12px;
    line-height: 124.19%;
    color: #000000;
    display: none;
    margin-bottom: 13px;
  }

  .goods__item:hover{
    max-width: 220px;
    display: flex;
    flex-direction: column;
    align-items: center;
    cursor: pointer;
  }

  .goods__item:hover .item-image-discount{
    display: flex;
  }

  .goods__item:hover .ranking__wrapper{
    display: flex;
  }
  .goods__item:hover .goods__item-button{
    display: flex;
  }

  .goods__item:hover .goods__item-text{
    display: none;
  }

  .goods__item:hover .goods__item-text-hover{
    display: block;
  }

  .ranking__wrapper{
    display: none;
    gap: 25px;
    margin-bottom: 10px;
  }

  .ranking__text{
    position: relative;
    display: block;
    font-family: var(--font-roboto-regular);
    font-weight: 400;
    font-size: 12px;
    line-height: 14px;
    color: #000000;
    
  }

  .ranking__text::after{
    content: '';
    background: url(assets/star-icon.svg) no-repeat center;
    width: 14px;
    height: 12px;
    position: absolute;
    left: 20px;
  }
  
  .ranking__number{
    display: block;
    font-family: var(--font-roboto-regular);
    font-weight: 400;
    font-size: 12px;
    line-height: 14px;
    color: #000000;
  }

  .goods__item-button{
    background: linear-gradient(96.78deg, #F64D4D -57.09%, #4D5EF6 101.17%);
    box-shadow: 0px 0px 40px rgba(0, 0, 0, 0.12);
    padding: 9px 57px;
    font-weight: 500;
    font-size: 14px;
    line-height: 16px;
    font-family: var(--font-roboto-regular);
    color: white;
    display: none;
  }

  .popup{
    position: fixed;
    inset: 0;
    z-index: -1;
    visibility: hidden;
    opacity: 0;
    transition: all ease 0.6s;
    display: flex;
    justify-content: flex-end;
    align-items: center;
    top: -1000px;
    background-color: rgba(174, 175, 184, 0.1);
  }

  .popup:target{
    visibility: visible;
    z-index: 2;
    opacity: 1;
    top: 0;
  }

  .overlay{
    position: absolute;
    inset: 0;
    z-index: -1;
  }

